          "quotes": [
            {
              "date": "2022-04-04",
              "horse": "Michaela's Boy",
              "horse_id": "4229840",
              "race": "British Stallion Studs EBF Novice Stakes (GBB Race)",
              "race_id": "806410",
              "course": "Windsor",
              "course_id": "crs_2418",
              "distance_f": "5",
              "distance_y": "1121",
              "quote": "Shane rode Michaela's Boy two weeks ago and said he might need it, but he was professional and I knew he wasn't going to run a bad race. He's a straightforward horse. He went to post really good and has been cantering on that ground at home. We might go to Chester for the Lily Agnes - Richard Hughes, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Michaela's Boy",
              "horse_id": "4229840",
              "quote": "He's a lovely chestnut we bought from Richard Hughes's yard and he has done nothing but please us. He's won his last two races for us at Newcastle and Chelmsford and, having arrived with a mark of 78, will be starting this season on 94. Although that's 16lb higher I think he's definitely capable of improving again. He was quite quirky when he came but we've ironed out his problems and I think we can go even further with him now as he's a much stronger individual. He finished down the field in a 5\u00bdf race at Chantilly on Tuesday, but hopefully he'll improve on that and he may go to all-weather finals day at Newcastle. The only problem is that the sprint there is over 6f and he didn't get that trip last year. That's not to say he won't now that he has bulked up, but I would prefer it if the race were over 5f. 22-03-23"
            }
          ],
