          "quotes": [
            {
              "date": "2021-08-31",
              "horse": "Arenas Del Tiempo",
              "horse_id": "3216252",
              "race": "John Benstead Handicap (A Jockey Club Grassroots Middle Distance Qualifier)",
              "race_id": "790726",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "10",
              "distance_y": "2217",
              "quote": "Arenas Del Tiempo wears her heart on her sleeve and is going in the right direction. She's rangey and can get a bit excitable, but I think she can go on with another winter under her belt. She's suited to Epsom - the twists and turns - and I'm already thinking what we can do with her here next year - Simon Dow, trainer."
            },
            {
              "date": "2021-07-22",
              "horse": "Arenas Del Tiempo",
              "horse_id": "3216252",
              "race": "Twickenham Fillies' Handicap",
              "race_id": "788036",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "10",
              "distance_y": "2189",
              "quote": "I thought Arenas Del Tiempo would lead as Hollie Doyle changed the whole game plan with the lovely ride she gave her to win at Brighton. She's at the right end of the handicap to still be learning and it's exciting to see what she can do now. We'll look to keep her to courses that suit this style and our 'home' track at Epsom would be perfect for her. Something at the August Bank Holiday fixture might be just what she wants - Simon Dow, trainer."
            }
          ],
