          "quotes": [
            {
              "date": "2023-07-12",
              "horse": "The Good Biscuit",
              "horse_id": "5125896",
              "race": "In Memory Of Sir Ian Pamphilon Restricted Novice Stakes (For horses In Band D) (GBB Race)",
              "race_id": "843193",
              "course": "Lingfield",
              "course_id": "crs_806",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "The Good Biscuit has backed up quite well. He was fresh and well on Monday morning so we thought this looked like a race we could win. He's got a good constitution so it was a straightforward decision after he ate up. One of his main rivals was taken out, but he still did it well. He went unsold so we brought him home, and he's probably had to run to about the same as he did last time, but when we go into nurseries it'll be tougher - Jack Channon, trainer."
            },
            {
              "date": "2023-07-08",
              "horse": "The Good Biscuit",
              "horse_id": "5125896",
              "race": "Smooth Breakfast With Gareth Evans Selling Stakes (IRE Incentive Race)",
              "race_id": "843130",
              "course": "Leicester",
              "course_id": "crs_780",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "The Good Biscuit had every right to go and do that and he did it well. We've always thought he was a nice two-year-old and these sellers have unbelievable prize-money, so it was a no-brainer for us to go there. It was a nice, easy race and he'll have a handicap mark now so we can go into nurseries and hopefully have a lot of fun with him. He's a horse who should improve. Nothing went right for him the first day at Carlisle, and his second start was pretty much like his first run. He was drawn on the wrong side in stall five, but Charlie gave him a nice ride and he finished well - Jack Channon, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "The Good Biscuit",
              "horse_id": "5125896",
              "quote": "He came here from the sales in late autumn and it's quite possible the change of scenery and routine here at Mowbray will revitalise him. I'm still finding out about him, but I sense he could shape into a decent sprinter. He makes his debut for us at Redcar on April 17. 09-04-25"
            }
          ],
