          "quotes": [
            {
              "date": "2022-09-03",
              "horse": "Reputation",
              "horse_id": "881321",
              "race": "Don Moss Memorial Handicap",
              "race_id": "818692",
              "course": "Thirsk",
              "course_id": "crs_2080",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "I think Reputation wants fresh soft ground, it only rained here today and we were in two minds whether or not to run, but Jimmy gave him a great ride and knew where the quick ground was down the back straight. He's an older horse and his owners have had the faith to come back after a long layoff when he came back to us earlier this year - Ruth Carr, trainer."
            },
            {
              "date": "2019-04-27",
              "horse": "Reputation",
              "horse_id": "881321",
              "race": "Celebrating Pipers Note Handicap",
              "race_id": "726281",
              "course": "Ripon",
              "course_id": "crs_1274",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "I decided to take the headgear off and start with a blank canvas with Reputation and it worked. I hope the handicapper isn't too hard on him-Ruth Carr, trainer"
            },
            {
              "date": "2017-06-03",
              "horse": "Reputation",
              "horse_id": "881321",
              "race": "Investec Asset Management Handicap",
              "race_id": "675370",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "6",
              "distance_y": "1323",
              "quote": "The better the ground the better his chance. Reputation ran quite well at York on his last start but the ground was very soft. He was beaten 13 lengths but lost those 13 lengths in the last 100 yards - John Quinn, trainer."
            },
            {
              "date": "2015-07-25",
              "horse": "Reputation",
              "horse_id": "881321",
              "race": "Sky Bet Making Betting Better Median Auction Maiden Stakes (Plus 10 Race)",
              "race_id": "630459",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Reputation is still a bit 'goony' and he'll improve again on that. He's in the sales races so he'll probably go for one of those, maybe the Doncaster one here next month - John Quinn, trainer."
            }
          ],
