            {
              "date": "2023-11-04",
              "horse": "Orne",
              "horse_id": "5313186",
              "race": "Betfred Horris Hill Stakes (Group 3) (Colts & Geldings)",
              "race_id": "853575",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "It wasn't the plan to make the running. Orne went last in, but he was first out. Normally he doesn't do a stroke when he is in front but I went on a fresh bit of ground, and he found a rhythm. Just towards the end he got a little bit lonely and ducked left, but he has done it well. It wasn't the plan to go on the far side as I wanted to drop in and get a lead and get there late. When I ended up in front I could see there was fresh ground there so I thought I might as well go there. He didn't stay the mile in the Autumn Stakes. He travelled good and he handled the ground, but he just didn't stay. He could get quicker this horse over the winter - Rab Havlin, jockey."
            }
