              "quote": "She's a low-grade filly but is a little angel and could easily have won three of her last four starts. Last winter we didn't know whether to keep her in training for this season. There was probably no-one more surprised than me when she won at Redcar in May. I thought she won at Leicester at the start of the month with a little bit more up her sleeve, and to be fair to her if she'd been drawn in the middle of them at Nottingham last time she'd have won there too. She ended up on the stands' rail and didn't quite get there. I'd like to think she'll progress a little bit more, although at a low level. 28-06-24"
