          "quotes": [
            {
              "date": "2021-08-20",
              "horse": "Gis A Sub",
              "horse_id": "3609037",
              "race": "Al Basti Equiworld Dubai Gimcrack Stakes (Group 2) (Colts & Geldings)",
              "race_id": "787383",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Goodwood was a cock-up, and it was my fault, but Gis A Sub has run a great race today. He has a huge stride and I told Kevin to let him use it. He did everything right and showed he's a very good horse. We've already had a board meeting and decided to wait until October and the Criterium de Maisons-Laffitte, a race we've won before - Kevin Ryan, trainer."
            },
            {
              "date": "2021-06-28",
              "horse": "Gis A Sub",
              "horse_id": "3609037",
              "race": "British Stallion Studs EBF Spindrifter Conditions Stakes (GBB Race)",
              "race_id": "786132",
              "course": "Pontefract",
              "course_id": "crs_1196",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Gis A Sub is still a bit babyish and was half pulling up in front. He'll be a better horse when getting a lead in a better race. I think there's an awful lot to come from him and races like the Gimcrack would definitely be on the agenda - Kevin Ryan, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Gis A Sub",
              "horse_id": "3609037",
              "quote": "He was a very talented two-year-old who then found it hard when he was set some big tasks last year. He's grown and strengthened again over the winter and is back down to a very workable mark now. It would be good to see him in the big Saturday handicaps. 03-05-23"
            },
            {
              "horse": "Gis A Sub",
              "horse_id": "3609037",
              "quote": "This fellow has plenty of ability as he showed last year when second in the Gimcrack Stakes, but unfortunately he tends to hold a lot back for himself. He has been a bit disappointing this season but has an entry in the Commonwealth Cup and I think we will fit him with cheekpieces to try to encourage him to put his best foot forward. 15-06-22"
            }
          ],
