          "quotes": [
            {
              "date": "2024-12-14",
              "horse": "Chemical Warfare",
              "horse_id": "3499117",
              "race": "ACS Tyres Services Handicap Chase (Go North Red Rum Series Qualifier)",
              "race_id": "881386",
              "course": "Newcastle",
              "course_id": "crs_962",
              "distance_f": "23.5",
              "distance_y": "5151",
              "quote": "Chemical Warfare is a little bit on the edge. He's a forward-going, keen sort of type, and you have to put a bit of trust in him because sometimes you tell him what to do and he likes to do the opposite. I know him pretty well now, I've ridden him all through the summer - Jack Tudor, jockey, speaking to Sky Sports Racing."
            },
            {
              "date": "2024-10-09",
              "horse": "Chemical Warfare",
              "horse_id": "3499117",
              "race": "Vickers.Bet Proud To Support British Racing Handicap Chase",
              "race_id": "876583",
              "course": "Sedgefield",
              "course_id": "crs_1482",
              "distance_f": "26.5",
              "distance_y": "5779",
              "quote": "Chemical Warfare loves this place. He enjoys the sharp track and we're not into the depths of winter, so they weren't going into the ground too deep, and he enjoyed that too. It's a long way up but I quite enjoy coming here. You want to be coming here with those that have a chance, so long may it continue. There are loads of options for a horse like him up this neck of the woods and down south nearer to us too. As long as he stays in good form, then there's plenty more fun to be had in staying chases with nice prize-money - Jack Tudor, jockey, speaking to Sky Sports Racing."
            }
          ],
