              "quote": "We bought him from France and he was very disappointing at the start of the year. The mistake we probably made was trying him as a juvenile hurdler as it didn't work. He was fit and we kept going with him, but sometimes horses from France need time to acclimatise and come to themselves. He's got a lot to prove and has shown nothing since we've had him, but he's a rarity in that his hurdles mark is lower than his Flat one. We're going to try to run him in a handicap hurdle in November after his summer break. If it clicks with him, he could be thrown in. 26-09-24"
